import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


export default function AllUsersResults(props) {

  const [data, setData] = React.useState([])
  React.useEffect(() => {
    fetch(`/api/v1/${props.colorProp}`)
      .then((res) => res.json())
      .then((data) => { setData(data.result); });
  }, []);

  return (
    <TableContainer component={Paper} sx={{ width: "75%", boxShadow: `0px 2px 1px -1px rgb(0 0 0 / 20%), 0px 1px 1px 0px ${props.colorProp}, 0px 1px 3px 0px rgb(0 0 0 / 12%)` }}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Color</TableCell>
            <TableCell>Group Name</TableCell>
            <TableCell >User Name</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>


          {Object.keys(data).map(color => <TableRow
            key={color}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
          ><TableCell component="th" scope="row" sx={{color: color}}>
              {color}
            </TableCell>
            <TableCell align="right">
              <Table sx={{ minWidth: 500 }} aria-label="simple table">
                {data[color].map(group => {
                  return <TableRow  sx={{ padding: "2px 10px", borderBottom: "1px solid rgba(224, 224, 224, 1)" }}> <TableCell align="left" sx={{ padding: "2px 10px", borderBottom: "none" }}>
                    {Object.keys(group)}
                    </TableCell>
                    {Object.keys(group).map ( user=> {return <TableCell align="right" sx={{ padding: "2px 10px", borderBottom: "none" }}>{group[user].map(user=><Table><TableRow><TableCell align="right"sx={{ padding: "2px 10px", borderBottom: "none" }}>{user}</TableCell></TableRow></Table>)}</TableCell>})}
                 </TableRow>
                })}
              </Table>
            </TableCell>
          </TableRow>)}




        </TableBody>
      </Table>
    </TableContainer>
  );
}
